import { View, Image } from 'react-native';
import React from 'react';

export default function Header() {
  return (
    <View>
      <View style={{ backgroundColor: '#FFFFFF', height: 96, width: '100%' }}>
        <Image source={require('../assets/logo.png')} />
      </View>
    </View>
  );
}
